import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const footer = () => {
  return (
    <>
      <footer>
        <Container>
          <Row>
            <Col
              className="text-center"
              style={{ position: "absolute", bottom: "0" }}
            >
              <span>Copyright &copy; Shopping App</span>
            </Col>
          </Row>
        </Container>
      </footer>
    </>
  );
};

export default footer;
